import {
  getAllProducts,
  getProductById,
  getAllCategories,
} from '../../services/apis/products';

export const signIn = () => (dispatch) => {
  signInApi()
    .then((res) => {
      if (res.data && res.data.success) {
        console.log('hellllo', res.data.data);

        dispatch({
          type: SET_PRODUCTS,
          payload: res.data.data,
        });
      }
    })
    .catch((err) => {
      console.log({ err });
    });
};
